    var editor = SW.getComponent('editor');
    var template = JSON.parse(editor.getValue());
    var model = {
        Name: template.Name,
        Type: template.Type,
        Category: template.Category,
        Layout: template.Layout,
        Description: template.Description,
        Details: template.Details
    }
    SW.executeAPI('PUT', 'templates/'+template.Id, null, model)
    .then( x => {
        SW.Toastr.toastr_Success("Saved");
    })
    .catch( x => {
        SW.Toastr.toastr_Error(x);
    })
}"}

